import React from 'react'

class Header extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      text: ''
    }
  }
  render() {
    const text = this.state.text
    const setText = (text) => {
      this.setState({
        text
      })

    } 
    const onAddItem = (e = {}) => {
      if (e.key === 'Enter' && text) {
        console.log('text',text)
      }
    }
    return (
      <div className="header">
        <h1 className="header_title">react todo app</h1>
        <input 
          className="header_input" 
          onChange={(e) => setText(e.target.value) }
          value={text}
          onKeyPress={(e) => onAddItem(e)}
        />

      </div>
    )
  }
}

export default Header
